import React from 'react';
import classes from './Magazine.module.css'
const Magazine = () => {
    const magazine = [
        {
            title: "Худи Storm Wolves 2021",
            imgFront: "https://sun9-38.userapi.com/2QqOGytsouGwSlIIpr3jT_A6w3TGsDM-9vFcUQ/5iCudIN7i44.jpg",
            imgBack: ""
        }
    ]
    return (
        <div>
            <div className={classes.productCard}>
                <h1 className={classes.productTitle}>Название продукта</h1>
                <img src={"https://sun9-38.userapi.com/2QqOGytsouGwSlIIpr3jT_A6w3TGsDM-9vFcUQ/5iCudIN7i44.jpg"} className={classes.productImage}/>
                    <div className={classes.productRating}>
                        <span className="star">&#9733;</span>
                        <span className="star">&#9733;</span>
                        <span className="star">&#9733;</span>
                        <span className="star">&#9733;</span>
                        <span className="star">&#9734;</span>
                    </div>
                    <div className={classes.productPrice}>Цена: $9.99</div>
                    <button className={classes.productBuyButton}>Купить</button>
                    <button className={classes.productBuyButton} onClick={changeImage}>Изменить картинку</button>
            </div>
        </div>
    );
};

export default Magazine;
